BEGIN TRANSACTION;
CREATE TABLE "Video" (
	`VideoID`	TEXT NOT NULL UNIQUE,
	`OwnerUserID`	TEXT NOT NULL,
	`ViewCount`	INTEGER,
	`UploadDate`	TEXT NOT NULL,
	`Title`	TEXT NOT NULL,
	`Artist`	TEXT,
	`Type`	TEXT,
	`State`	TEXT,
	PRIMARY KEY(VideoID),
	FOREIGN KEY(`OwnerUserID`) REFERENCES UserProfile
);
CREATE TABLE "UserProfile" (
	`UserID`	TEXT NOT NULL UNIQUE,
	`First_name`	TEXT NOT NULL,
	`Last_name`	TEXT NOT NULL,
	`Gender`	TEXT,
	`DoB`	TEXT,
	`Email`	TEXT NOT NULL,
	`DateMembered`	TEXT NOT NULL,
	`LastDateAccessed`	TEXT NOT NULL,
	PRIMARY KEY(UserID)
);
CREATE TABLE "Friend_Group" (
	`UserID`	TEXT NOT NULL,
	`FriendGroup`	TEXT NOT NULL,
	`GrantedPersonalInfo`	TEXT NOT NULL,
	`GrantedChannels`	TEXT NOT NULL,
	FOREIGN KEY(`UserID`) REFERENCES User_Profile
);
CREATE TABLE "FriendList" (
	`UserID`	TEXT NOT NULL,
	`Searched_Friend_Email`	TEXT NOT NULL,
	`FriendRegistered`	TEXT NOT NULL,
	`FriendAgreed`	TEXT NOT NULL,
	`FriendID`	TEXT NOT NULL,
	`FriendGroup`	TEXT NOT NULL,
	FOREIGN KEY(`UserID`) REFERENCES UserProfile,
	FOREIGN KEY(`FriendID`) REFERENCES UserProfile
);
CREATE TABLE "Channel" (
	`OwnerID`	TEXT NOT NULL,
	`ChannelID`	TEXT NOT NULL UNIQUE,
	`ChannelType`	TEXT,
	`VideoIDs`	TEXT,
	`DateCreated`	TEXT NOT NULL,
	PRIMARY KEY(ChannelID),
	FOREIGN KEY(`OwnerID`) REFERENCES UserProfile
);
COMMIT;
